define({"topics" : [{"title":"Table Name Pattern","shortdesc":"\n                  <p class=\"shortdesc\">You define the group of tables that the JDBC Multitable Consumer origin reads by         defining a table name pattern for\n                     the table configuration. The origin reads all tables whose         names match the pattern. \n                  </p>\n               ","id":"concept_ank_41x_4y","href":"datacollector\/UserGuide\/Origins\/MultiTableJDBCConsumer.html#concept_ank_41x_4y","menu": {"hasChildren":false,},"tocID":"concept_ank_41x_4y-d46e36850","topics":[]},{"title":"Offset Column and Value","shortdesc":"\n                  <p class=\"shortdesc\">The JDBC Multitable Consumer origin uses an offset column and initial offset value to         determine where to start reading\n                     data within tables and partitions.\n                  </p>\n               ","id":"concept_yfx_mhx_4y","href":"datacollector\/UserGuide\/Origins\/MultiTableJDBCConsumer.html#concept_yfx_mhx_4y","menu": {"hasChildren":false,},"tocID":"concept_yfx_mhx_4y-d46e36895","topics":[]}]});